export default function Info({country, start, end, caption}){

    const imageErrorCatch = () =>{
        return(
            <h1></h1>
        )
    }
    ImageCollector()
    return(
        <div>
            {country}
            <br>
            </br>
            {start} - {end}
            <br/>
            {caption}

        </div>
    )

}
